$.a46=H.b(["Peter Darrach Matthews","about"],t.i)
$.a45=H.b(["\tHi! My name is Peter Darrach Matthews and I\u2019m a third-year electrical engineering student at Queen\u2019s University in Kingston, Ontario. I\u2019m currently looking for a 12-16-month internship beginning in the summer of 2021. I\u2019m dedicated and hardworking with varied work and volunteer experience. I\u2019m also a proven leader who has received many awards recognizing my leadership abilities, including the national Schulich Leader Scholarship for Engineering valued at $100,000. Check out the rest of this website to learn more about my skills!"],t.i)
$.a44=H.b([1],t.V)
$.a5i=H.b(["This Website","Redstone Calculator","Lunar Anchor","web","mccalc","lunaranchor"],t.i)
$.a5h=H.b(["\tAfter my experience with the EngSoc IT Operations team (see the volunteer experiences page), I decided that I wanted to do something to further grow my web development skills. I knew a few people who had made personal websites where they posted their resumes and relevant experience, so I decided to make my own website to showcase my skills.\n  \n\tI decided to use Flutter to design my website. Flutter allows you to make an iOS, Android, and web app all from the same code base using just one programming language: dart. This, combined with the fact that I already had some rudimentary experience using Flutter at a hackathon, made Flutter the perfect choice for me.\n  \n\tBy using YouTube videos and reading a lot of Stack Overflow posts I managed to design this simple website and host it for free on GitHub. By working on this project I learned a lot about web development and object oriented programming. But more than that, this project helped me learn how to learn independently and how to solve problems without someone by my side guiding me.","\tAfter completing courses such as digital systems and computer architecture, I decided I wanted to try and apply that knowledge by creating a basic digital electronic device. I also enjoy video games, so when I realized that it was possible to create logic gates and digital circuits in the popular sandbox game Minecraft I decided that I would use the game to create a simple calculator capable of adding two numbers between 0 and 999 together. \n  \n\tThe final calculator uses seven segment displays to show input and output. The two operands and final output are stored as binary coded decimal in nine four-bit registers. A four-to-seven decoder is used to convert each binary digit into the seven segment output. Control circuitry decides which digit to send to which part of the display, as only one digit can be processed at a time. A ten digit keypad is used to accept input, which is converted into binary coded decimal. Control circuitry decides which of the registers to store the digit in. The actual addition is done digit by digit, similar to how elementary school students are taught addition. Three four-bit ripple-carry adders perform addition on each pair of digits, and more control circuitry decides whether it is necessary to \u2018carry the one\u2019 over to the next digit. The result of the addition is then stored in three registers. When the user chooses to view the result of the operation, the three digits of the display are updated one by one to show the result. If the result of over 1000 then this can also be displayed easily without the need for a converter: the \u2018carry\u2019 output from the last adder is sent directly to the display.\n  \n\tDesigning a calculator to work in Minecraft also presented its own unique challenges. The main challenge was the Minecraft mechanic in which extending redstone signals over long distances introduces a delay in the signal which is much more significant than in a real life calculator or computer. This meant that the calculator had to be as compact as possible to ensure calculations could be performed efficiently. Additionally, because of the significant signal delay, sending a consistent clock signal throughout the calculator was impractical. Therefore, the calculator was designed to work with only asynchronous, combinational logic. ","\tHelping to design a lunar rover for the Canadian Space Agency isn\u2019t what you might expect to do during your first year of an engineering program, but that\u2019s exactly what I got to do in my first year of university.\n  \n\tAt Queen\u2019s, teams of first-year engineering students get the opportunity to work with a real client on a design project during our second semester. These clients can be the university\u2019s design teams, local businesses and charities, and even national companies or organizations. For my project, my team was one among six paired with the Canadian Space Agency (CSA). We were tasked with developing a proof-of-concept design for an anchoring system to stabilize a lunar rover on crater slopes.\n  \n\tAfter examining several possible solutions, we decided to base our lunar anchor on a helical design, a type of anchor already used here on Earth. We used an iterative process to design our anchor, which involved testing 3D printed scale models of the anchor and modifying the design based on the test results. Each week, we had a video conference with an engineer at the CSA to discuss our progress and the next steps in the project.\n  \n\tAt the end of the semester, the CSA came to Queen\u2019s so each team could present its design and perform testing with a mock lunar rover. Having the opportunity to work on such an interesting project with a high-profile client was a fantastic introduction to engineering design."],t.i)
$.a5g=H.b([2,3,3],t.V)
$.a5I=H.b(["Teaching Assistant","Development Engineering Intern","Barista and Clerk","ta","intern","barista"],t.i)
$.a5H=H.b(["\tOver the summer of 2020 I worked as a teaching assistant for Queen\u2019s University in the online course APSC221 \u2013 Business and Economics in Engineering. The course covers business planning for the enterprise, enterprise economic analysis, project management process, project economic analysis, risk analysis and management, quality management, and change management. My responsibilities included marking assignments, midterms, and final exams, as well as proctoring online final exams. ","\tDuring the summer of 2019 I worked as a development engineering intern in the City of Sarnia\u2019s engineering department. One of my key responsibilities was drafting and updating technical corporate documents such as city standard specifications, capital project sheets, and city council reports. I also created standard engineering drawings in AutoCAD, such as specifications for the use of steel road plates in construction sites. Some more of my responsibilities and projects included assisting with the tendering of capital rehabilitation projects, installing traffic monitoring equipment in the field, and assisting with the creation of a 10-year vehicle fleet replacement plan.\n  \n\tAlthough I learned valuable technical skills, such as the basics of AutoCAD, I felt that my time at the City of Sarnia taught me even more about the soft skills necessary to succeed in the workplace. I learned that a quick one-on-one or a phone call is generally a much quicker way to get things done than an email. As an employee of the city I also interacted with members of the public, which helped improve my communication and professionalism. I also learned to be self-sufficient and to self-teach where appropriate rather than always waiting for my boss to tell me what to do.","\tAs a high school student I worked part-time for two and a half years (2016-2018) as a clerk and barista at a local coffee shop. I handled orders at the cash register and made customers drinks as a barista. I was also responsible for cleaning the store and counting the tills. \n  \n\tAs my first job, working as a barista taught me a great deal. I learned how to be polite and courteous with customers while working efficiently to complete their orders and my other responsibilities. "],t.i)
$.a5G=H.b([1,2,1],t.V)
$.a5C=H.b(["Student Senator","BED Fund Representative","EngSoc IT Operations Team Member","senator","bed","itops"],t.i)
$.a5B=H.b(["\tIn 2019 I was elected to a two-year term as a student senator for the Engineering Society. My responsibilities include attending, voting, and proposing motions and amendments at Queen\u2019s Senate meetings, Engineering Faculty Board meetings, and Engineering Society Council meetings. \n  \n\tThe Senate is one of three governing bodies of Queen\u2019s University, and it is concerned with matters of an academic nature affecting the university as a whole. The Senate is composed of the university administration including the principal and deans, as well as elected faculty and student senators.\n  \n\tBeing involved in student government has taught me a lot about responsibility. As someone who holds an elected position, it\u2019s important that I\u2019m voicing the opinion of my fellow students and working for their wellbeing. I\u2019ve also improved my communication skills through this role. When discussing and debating motions, whether they\u2019re at Senate, Faculty Board, or EngSoc Council, it\u2019s important to be clear and concise, a skill that I\u2019ve honed (and continue to improve) through this role. ","\tFrom 2018 to 2020 I served as a representative for the BED Fund, first as the First Year Representative and in the following academic year as the General Fund Representative. The BED Fund is a student-run organization that aims to purchase equipment and resources to improve engineering education at Queen\u2019s. It collects optional donations from students at the beginning of the academic year. Representatives are tasked with researching and recommending purchases to be made with the donations. As the First Year Representative my budget was $35,000, and as the General Fund Representative my budget was $50,000.\n  \n\tAs a BED Fund Representative I learned a lot about professionalism and time management. I often contacted professors and staff at the university to get ideas on what equipment or resources that the faculty wasn\u2019t willing to purchase with its own budget, and it was very important to keep these conversations professional as email correspondence were included as appendices in proposals. In addition, as professors are often very busy, I learned that time management and making contact as early in the school year as possible was the best way to ensure that the proposal could be completed on time. ","\tAt the start of my second year I\u2019d gained some great soft skills through involvement in extracurriculars like Engineering Society Council, but I decided that I also wanted to join something to grow my technical skills. I decided to join the EngSoc IT Operations team because I wanted to improve my programming skills and was interested in learning about web development. The IT Ops team maintains the EngSoc servers and creates/updates EngSoc websites. We used WordPress as well as Ruby/Ruby on Rails. The team taught me the basics of web development which I further developed in my own time to create this website. "],t.i)
