$.a5p=H.b(["\tI have strong written and oral communication skills and am bilingual (English and French). I have excellent leadership abilities as well as time management skills. I have experience programming in C, MATLAB, Dart/Flutter, and Ruby/Ruby on Rails. I also have experience with RISC-style assembly language and VHDL hardware description. In addition to programming, I have experience with Solid Edge and AutoCAD CAD tools.","\tSchulich Leader Scholar for Engineering, Science 1946 Memorial Upper Year Scholarship, 2019-2020 Dean\u2019s Scholar, 2018-2019 Dean's Scholar, Nicol Scholar, High School Valedictorian, Governor General\u2019s Academic Medal (Bronze), OPC Principal\u2019s Award for Student Leadership, Optimists\u2019 Oratorical Competition Winner for South Western Ontario (2017)"],t.i)
